import React from 'react';

 function MenuData({menuData}) {
    const style = {
        alignItems: 'center',
        margin: 'auto'
    }
    //console.log(menuData)
     
  return (
    
      <>
        {
            menuData.map((currEle) => 
            <div className='main'>
                <div className='background' >
                <div className='menu-card' key={currEle.id}>
                    <div className='menuItem'>
                        <h4 className="number">{currEle.id}</h4>
                        <h3 className="name">{currEle.name}</h3>
                        <img  style={style} src={currEle.image} alt="images" className='image' />
                        <h3 className="price">{currEle.price}</h3>
                    </div>
                </div>
            </div>
            </div>
            )
        }
           
            </>
  )
}

export default MenuData;
